import React from 'react';


function NavButtons(props){




    return(
        <div>
            <button className="btn bShAcconuts2 m-4">My Accounts</button>
            <button onClick={ ()=> {
                this.props.history.replace('/login');
            }}className="btn bShAcconuts m-4">NewAcconut</button>

            

        </div> 
    )
}
export default NavButtons;
